import { useParams } from "react-router";
import { useState } from "react";
export default function Services(){
    let params= useParams();
    let servId=Number(params.servicesId)
const [nationalID , setnationalID]=useState("")
const [servicetype , setservicetype]= useState("")
const [medicalconsulting ,setmedicalconsulting ]= useState("")
const [appointment, setappointment]= useState("")
const [legalconsulting, setlegalconsulting]= useState("")


function handlenationalID(event){
    setnationalID((event.target.value));
}
function handleservicetype(event){
    setservicetype((event.target.value));
}
    if(servId == 1){
        return(
            <main>
                <h1>Sign Lnguage Training</h1>
                <form>
                    <label>National ID</label>
                    <input type="text" ></input><br />
                    <label>Service Type</label>
                    <input type="text"></input><br />
                </form>
            </main>
        );
    }
    else if(servId == 2){
        return(
            <main>
                <h1>Job Trining </h1>
                <form>
                <label>National ID</label>
                    <input type="text" ></input><br />
                    <label>Service Type</label>
                    <input type="text"></input><br />

                    {/* <label>phone number</label>
                    <input type="text"></input><br />
                    <label>gender</label><br />
                <input type="radio" value="male" /><label>male</label><br />
                <input type="radio" value="female" /><label>female</label><br /> */}

                </form>
            </main>
        );
    }
    else if(servId == 3){
        return(
            <main>
                <h1>Request a Doctor</h1>

                <form>
                    <label>National ID: </label>
                    <input type="text" onChange={handlenationalID} ></input><br />
                    <label>Service Type: </label>
                    <input type="text"></input><br />

                    <label>Medical Consulting: </label> <br />
                    <textarea rows="4" cols="50" placeholder="Write your medical Consulting here"> </textarea>

                    <br />
                    <input type="checkbox" /> 
                    <label> an appointment</label> <br />
                    <button type="submit">submit </button>
                </form>

            </main>
        );
    }
    else if(servId == 4){
        return(
            <main>
                <h1>Request a Lawyer</h1>

                <form>
                    <label>National ID</label>
                    <input type="text" ></input><br />
                    <label>Service Type</label>
                    <input type="text"></input><br />

                    <label>legal Consulting: </label> <br />
                    <textarea rows="4" cols="50" placeholder="Write your legal Consulting here"> </textarea>

                    <br />
                    <input type="checkbox" /> 
                    <label> an appointment</label><br />
                    <button type="submit">submit </button>
                </form>

            </main>
        );
    }
}
